import React, { Component } from 'react';
import Card from 'react-bootstrap/Card';
import CardDeck from 'react-bootstrap/CardDeck';
import ListGroup from 'react-bootstrap/ListGroup';
import ListGroupItem from 'react-bootstrap/ListGroupItem';
import '../css/output.css'
import Dropdown from "react-bootstrap/Dropdown";

class OutputContainer extends Component {
    indices = [0,1,2,3];

    render() {
        return (
            <div className="output-parent">
                <CardDeck>
                    {[0,0,0,0].map(() => (
                        <Card style={{ width: '20rem' }}>
                            <Card.Img variant="top" src={require('../images/test1.jpg')} />
                            <Card.Body>
                                <Card.Title>YVES SAINT LAURENT</Card.Title>
                                <Card.Text>
                                    Rouge Pur Couture The Slim Matte Lipstick
                                </Card.Text>
                            </Card.Body>
                            <ListGroup className="list-group-flush">
                                <ListGroupItem>Price: $39.00</ListGroupItem>
                                <ListGroupItem>Color: Matte finish</ListGroupItem>
                                <ListGroupItem>Keywords: Interview</ListGroupItem>
                            </ListGroup>
                            <Card.Body>
                                <Card.Link href="#">Product Link on Sephora.com</Card.Link>
                            </Card.Body>
                            <Card.Footer>
                                <small className="text-muted">Last updated 3 mins ago</small>
                            </Card.Footer>
                        </Card>
                    ))}

                </CardDeck>
            </div>
        )
    }
}

export default OutputContainer
